import React from 'react';
import {Link} from "react-router-dom";



function DashboardPage() {
    return (
        <>
            <header>
                <h1>dashboard</h1>
            </header>
            <main>
                <div className="columns">
                    <div className="column">
                        <Link to='/dashboard' className="button is-primary">
                            Dashboard
                            </Link>
                    </div>
                </div>
            </main>
        </>
    );
}

export default DashboardPage;
